import React from 'react';
import ReactDOM from 'react-dom';
import AddStudentForm from './AddStudentForm';
import swal from 'sweetalert';
import { Student } from './../dto/StudentDTO';

export default class PopUp {

    show() {
        let attributeElements = document.getElementsByClassName("studentAttribute");
        let attributes = [...attributeElements].map(htmlElemtent => htmlElemtent.value);
        let student = new (Function.prototype.bind.apply(Student, attributes));

        let container = document.createElement("div");
        ReactDOM.render(<AddStudentForm/>, container);
        let el = container.firstChild;

        swal({
            title: "New Student",
            content: el,
            className: "swal-show",
            button: {
                confirm: {
                    text: "OK",
                    closeModal: true
                },
                cancel: {
                    text: "Cancel",
                    closeModal:true
                }
            }
        });
    }

}
